import React, {Component} from 'react';

class Showuser extends Component {

    state  = {
        users: []
    };

    

    render() {
        return (
            <div className="container">
                <table className="table border">
                    <thead>
                    <tr>
                        <th>id</th>
                        <th>name</th>
                        <th>email</th>
                        <th>phone</th>
                        <th>gender</th>
                        <th>vehicle</th>
                        <th>country</th>
                    </tr>
                    </thead>
                    <tbody>{
                        this.state.users.map((user , index) => (
                            <tr key={index}>
                                <th>{index + 1}</th>
                                <td>{user.name}</td>
                                <td>{user.email}</td>
                                <td>{user.phone}</td>
                                <td>{user.gender}</td>
                                <td>{user.vehicle}</td>
                                <td>{user.country}</td>
                            </tr>
                        ))
                    }
                    </tbody>
                </table>
            </div>
        );
    }
}

export default Showuser;
